{
  "outputs": [{
    "name": "schema",
    "widget-type": "schema"
  }],
  "jump-config": {"datasets": [{"ref-property-name": "referenceName"}]},
  "metadata": {"spec-version": "1.0"},
  "configuration-groups": [
    {
      "label": "Basic",
      "properties": [
        {
          "widget-type": "textbox",
          "name": "referenceName",
          "label": "Reference Name",
          "widget-attributes": {"placeholder": "Name used to identify this source for lineage"}
        },
        {
          "widget-type": "select",
          "name": "queryMode",
          "label": "Data Retrieval Mode",
          "widget-attributes": {
            "default": "Single Object",
            "values": [
              "Multi Object",
              "Single Object"
            ]
          }
        }
      ]
    },
    {
      "label": "Single Object Retrieval",
      "properties": [
        {
          "widget-type": "select",
          "name": "objectName",
          "label": "Object",
          "widget-attributes": {
            "default": "Data Extension",
            "values": [
              "Bounce Event",
              "Data Extension",
              "Email",
              "Mailing List",
              "Notsent Event",
              "Open Event",
              "Sent Event",
              "Unsub Event"
            ]
          },
          "plugin-function": {
            "widget": "outputSchema",
            "output-property": "schema",
            "omit-properties": [{"name": "schema"}],
            "label": "Get Schema"
          }
        },
        {
          "widget-type": "textbox",
          "name": "dataExtensionKey",
          "label": "Data Extension External Key",
          "widget-attributes": {"placeholder": "External key of the Data Extension from which data to be read."}
        }
      ]
    },
    {
      "label": "Multi Object Retrieval",
      "properties": [
        {
          "widget-type": "multi-select",
          "name": "objectList",
          "label": "Object List",
          "widget-attributes": {
            "default": "Data Extension",
            "delimiter": ",",
            "options": [
              {
                "id": "Bounce Event",
                "label": "Bounce Event"
              },
              {
                "id": "Data Extension",
                "label": "Data Extension"
              },
              {
                "id": "Email",
                "label": "Email"
              },
              {
                "id": "Mailing List",
                "label": "Mailing List"
              },
              {
                "id": "Notsent Event",
                "label": "Notsent Event"
              },
              {
                "id": "Open Event",
                "label": "Open Event"
              },
              {
                "id": "Sent Event",
                "label": "Sent Event"
              },
              {
                "id": "Unsub Event",
                "label": "Unsub Event"
              }
            ]
          }
        },
        {
          "widget-type": "csv",
          "name": "dataExtensionKeyList",
          "label": "Data Extension External Keys",
          "widget-attributes": {"placeholder": "External keys of the Data Extensions from which data to be read."}
        },
        {
          "widget-type": "textbox",
          "name": "tableNameField",
          "label": "Table Name Field",
          "widget-attributes": {
            "default": "tablename",
            "placeholder": "The name of the field that holds the table name."
          }
        }
      ]
    },
    {
      "label": "Filter",
      "properties": [{
        "widget-type": "textbox",
        "name": "filter",
        "label": "filter",
        "widget-attributes": {"placeholder": "data filter criteria"}
      }]
    },
    {
      "label": "Authentication",
      "properties": [
        {
          "widget-type": "textbox",
          "name": "clientId",
          "label": "Client ID",
          "widget-attributes": {"placeholder": "Salesforce Marketing Cloud Client ID"}
        },
        {
          "widget-type": "password",
          "name": "clientSecret",
          "label": "Client Secret",
          "widget-attributes": {"placeholder": "Salesforce Marketing Cloud Client Secret"}
        },
        {
          "widget-type": "textbox",
          "name": "authEndpoint",
          "label": "Authentication Base URI",
          "widget-attributes": {"placeholder": "Salesforce Auth API Endpoint e.g. https://instance.auth.marketingcloudapis.com"}
        },
        {
          "widget-type": "textbox",
          "name": "soapEndpoint",
          "label": "SOAP API Endpoint",
          "widget-attributes": {"placeholder": "Salesforce SOAP API Endpoint e.g. https://instance.Salesforce.soap.marketingcloudapis.com/Service.asmx"}
        },
        {
          "widget-type": "textbox",
          "name": "restEndpoint",
          "label": "REST API Base URI",
          "widget-attributes": {"placeholder": "Salesforce REST API Endpoint e.g. https://instance.rest.marketingcloudapis.com"}
        }
      ]
    }
  ],
